import * as React from 'react';
import TableCell from '@mui/material/TableCell';
import TableRow from '@mui/material/TableRow';
import { Button } from '@mui/material';

export default function Transaction(props) {
  const [transactionStatus, setTransactionStatus] = React.useState(true);

  const { transaction } = props

  const updateTransactionStatus = (event, transactionStatus) => {
    event.preventDefault();
    setTransactionStatus(!transactionStatus)
  }

  return (
    <TableRow key={transaction._id}>
      <TableCell>{transaction._id}</TableCell>
      <TableCell>{transaction.payorEIN}</TableCell>
      <TableCell>{transaction.payeeId}</TableCell>
      <TableCell>{transaction.employeeId}</TableCell>
      <TableCell>{transaction.accountNumber}</TableCell>
      <TableCell>{transaction.payeeId}</TableCell>
      <TableCell align="center">{`$${transaction.amount}`}</TableCell>
      <TableCell align="center">{transaction.accepted.toString()}</TableCell>
      <TableCell align="center">
        <Button
          component="label"
          variant="outlined"
          sx={{ marginRight: "1rem" }}
          onClick={(event) => {updateTransactionStatus(event, transactionStatus)}}
        >
          {(!transaction.accepted).toString()}
        </Button>
      </TableCell>
    </TableRow>
  );
}
